ale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1516520","type":"CustomJS"},{"attributes":{"factors":["0","1"],"palette":["tomato","lime"]},"id":"1516114","type":"CategoricalColorMapper"},{"attributes":{},"id":"1516285","type":"RedoTool"},{"attributes":{"axis":{"id":"1516277"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1516280","type":"Grid"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"1516160","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"#d62728","line_width":1.3,"x":{"field":"index"},"y":{"field":"cdl_z(O,H,L,C)_0_4"}},"id":"1516499","type":"Line"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"point_policy":"follow_mouse","renderers":[{"id":"1516308"}],"tooltips":[["Date","@datetime{%c}"],["Size","@size{0,0}"],["P/L","@returns_short{+0.[000]%}"]]},"id":"1516312","type":"HoverTool"},{"attributes":{},"id":"1516099","type":"RedoTool"},{"attributes":{"coordinates":null,"data_source":{"id":"1516111"},"glyph":{"id":"1516440"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1516442"},"nonselection_glyph":{"id":"1516441"},"view":{"id":"1516444"}},"id":"1516443","
